import "./profile.css";

export default function Profile() {
  return (
    <section className="profile-section">
      <div className="profile-container">
        {/* LEFT: Description */}
        <div className="profile-text">
          <h1 className="profile-name">Tesfalem Markos</h1>
          <p className="profile-desc">
            I build modern, scalable, and user-friendly web applications using Node.js, PHP, JavaScript, React, and Bootstrap.
          </p>
        </div>

        {/* RIGHT: Profile Image */}
        <div className="profile-image-container">
          <img
            src="/profile.jpg"
            alt="Tesfalem Markos"
            className="profile-image"
          />
        </div>
      </div>
    </section>
  );
}
